Edit the Caddy configuration file to reverse proxy incoming traffic to Conduwuit sudo vim /etc/caddy/Caddyfile /etc/caddy/Caddyfile <domain.name>, <domain.name>:8448 { reverse_proxy 127.0.0.1:6167
} Enable and start both the Caddy and the Conduwuit services. sudo systemctl enable --now caddy
sudo systemctl enable --now conduwuit
